import React from "react";
import styled from "styled-components";

const Brands = () => {
    return (
        <BoxSection>
            <WrapContainer className="container">
                <WrapImg>
                    <img
                        src="../images/home-page/space-header.png"
                        alt="header-brand-page-image"
                    />
                </WrapImg>
                <Content>
                    <Title>Horizontal Logo</Title>
                    <WrapperLogo>
                        <BrandLogo>
                            <BackgroundImg>
                                <img
                                    src="../images/contributor-page/orbit-background.svg"
                                    alt=""
                                />
                            </BackgroundImg>
                            <LogoImg>
                                <img
                                    src="../images/logo/logo-forbitspace-dark.png"
                                    alt=""
                                />
                            </LogoImg>
                            <LinkImg>
                                <a href="/">.svg</a>{" "}
                                <a
                                    href="http://localhost:4000/images/logo/logo-forbitspace-dark.png"
                                    target="_blank"
                                    rel="noopener noreferrer"
                                >
                                    .png
                                </a>
                            </LinkImg>
                        </BrandLogo>
                        <BrandLogo>
                            <BackgroundImg>
                                <img
                                    src="../images/contributor-page/orbit-background.svg"
                                    alt=""
                                />
                            </BackgroundImg>
                            <LogoImg>
                                <img
                                    src="../images/logo/logo-forbitspace-dark.png"
                                    alt=""
                                />
                            </LogoImg>
                            <LinkImg>
                                <a href="/">.svg</a> <a href="/">.png</a>
                            </LinkImg>
                        </BrandLogo>
                        <BrandLogo>
                            <BackgroundImg>
                                <img
                                    src="../images/contributor-page/orbit-background.svg"
                                    alt=""
                                />
                            </BackgroundImg>
                            <LogoImg>
                                <img
                                    src="../images/logo/logo-forbitspace-dark.png"
                                    alt=""
                                />
                            </LogoImg>
                            <LinkImg>
                                <a href="/">.svg</a> <a href="/">.png</a>
                            </LinkImg>
                        </BrandLogo>
                    </WrapperLogo>
                </Content>
            </WrapContainer>
        </BoxSection>
    );
};

const BoxSection = styled.section`
    position: relative;
    padding: 8vh 0 0;
    margin: 0 0 2rem;
    @media (max-width: 770px) {
        padding-top: 60px;
        margin: 0 0 1rem;
    }
`;
const WrapContainer = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    gap: 20px;
    @media (max-width: 768px) {
        /* flex-direction: column-reverse; */
    }
`;
const WrapImg = styled.div`
    /* width: 40%; */
    /* max-width: 450px; */
    @media (max-width: 768px) {
        /* width: 50%; */
    }
`;
const Content = styled.div``;
const Title = styled.div`
    font-size: 28px;
    font-weight: 200;
`;
const WrapperLogo = styled.div`
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    gap: 2rem;
    @media (max-width: 576px) {
        flex-direction: column;
    }
`;
const BrandLogo = styled.div`
    max-width: 450px;
    width: 32%;
    /* background-color: #0c3d68; */

    padding: 1rem;
    border-radius: 16px;
    display: flex;
    align-items: center;
    justify-content: center;

    position: relative;
    @media (max-width: 576px) {
        width: 100%;
    }
`;
const LogoImg = styled.div`
    width: 55%;
    max-width: 250px;
    position: absolute;
`;
const BackgroundImg = styled.div`
    opacity: 0.45;
`;
const LinkImg = styled.div`
    position: absolute;
    bottom: 6rem;
    a {
        text-decoration: none;
        color: #fff;
    }
`;

export default Brands;
